import React from "react";
import { FC, useState } from "react";
import Form from "react-bootstrap/Form";
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";
import { CompanyInfo } from "../../api/domain/company-info";

export interface CompanyInfoFormProps {
  companyInfo: CompanyInfo;
}

export const CompanyInfoForm: FC<CompanyInfoFormProps> = ({ companyInfo }) => {
const [name, setName] = useState(companyInfo.name);
const [foundationYear, setFoundationYear] = useState(companyInfo.foundationYear);
const [numEmployees, setNumEmployees] = useState(companyInfo.numEmployees);


  return (
    <>
      <h2>Информация о компании</h2>
      <Form>
        <Form.Group as={Row} controlId="formPlaintextCompanyName">
          <Form.Label column sm="2">
            Название компании
          </Form.Label>
          <Col sm="10">
            <Form.Control defaultValue={companyInfo.name} />
          </Col>
        </Form.Group>
        <Form.Group as={Row} controlId="formPlaintextFoundationYear">
          <Form.Label column sm="2">
            Год основания
          </Form.Label>
          <Col sm="10">
            <Form.Control defaultValue={companyInfo.foundationYear} />
          </Col>
        </Form.Group>
        <Form.Group as={Row} controlId="formPlaintextNumEmployees">
          <Form.Label column sm="2">
            Количество сотрудников
          </Form.Label>
          <Col sm="10">
            <Form.Control defaultValue={companyInfo.numEmployees} />
          </Col>
        </Form.Group>
      </Form>
    </>
  );
};
